import React from 'react';
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();
  const userName = JSON.parse(localStorage.getItem('user'));

  const handleLogout = () => {
    localStorage.removeItem("loggedin");
    navigate('/login');
  };

  return (
    <div className="container-fluid min-vh-100 d-flex flex-column align-items-center justify-content-center bg-light">
      <div className="card p-4 shadow-sm" style={{ maxWidth: '300px', width: '100%' }}>
        <h3 className="text-center mb-3">Home Page</h3>
        <p className="text-center mb-4">Welcome, {userName?.name}</p>
        <button className="btn btn-primary w-100" onClick={handleLogout}>
          Logout
        </button>
      </div>
    </div>
  );
};

export default Home;
